import React, {useState, useEffect} from 'react'
import '../styling/doctors.css'

export default function ViewDoctors(){

    const[doctors, setDoctors] = useState([])
    const[search, setSearch] = useS

    useEffect(() => {
        fetch('/doctors')
        .then(response => response.json())
        .then(data => setDoctors(data))
    },[])

    const allDoctors = doctors.map((doctor) => {
        return(
            <tr key={doctor.id}>
                <td>{doctor.name}</td>
                <td>{doctor.phone}</td>
                <td>{doctor.speciality}</td>
                <td>{doctor.location}</td>
            </tr>
        )
    })

    return(
        <div id='doctors-page'>

            <input type='search' className='form-control border-primary' style={{width: '200px'}} placeholder='Search' id='search-input'/> 

            <table className='table' id='doctors-table'>

                <thead className='bg-primary'>
                    <tr>
                        <td className='text-light'>Name</td>
                        <td className='text-light'>Contact</td>
                        <td className='text-light'>Speciality</td>
                        <td className='text-light'>Location</td>
                    </tr>
                </thead>
                <tbody>
                    {allDoctors}
                </tbody>
            </table>

        </div>

    )
}
